import React from "react";

export default function UserSetup() {
  return (
    <div className="w-96 bg-white rounded-lg">
      <input
        className="mt-20 absolute bg-black"
        type="text"
        placeholder="Enter your username"
      ></input>
      <button className="bg-white mt-40 relative text-black rounded border-solid border-2">
        START GAME
      </button>
    </div>
  );
}
